<H1><A NAME="rc2113"></A><SUP></SUP>Resource Compiler Error RC2113</H1>

<P class=dt><B>END expected in dialog</B></P>

<P>The <B>END</B> keyword must occur at the end of a <B>DIALOG</B> statement. Make sure there are no open quotes left from the preceding statement.</P>
